import React from 'react';
import { Outlet, Link } from 'react-router-dom';
import PropTypes from 'prop-types';

const Nav = (props) => {
    return (
        <>
            <nav className='list-none'>
                <Link to='/'>
                    Présentation
                </Link>
                <Link to='/curriculum'>
                    <li>Mes projets</li>
                </Link>
                <Link to='/contact'>
                    <li>Contact</li>
                </Link>
            </nav>
            <Outlet />
        </>
    );
};

Nav.propTypes = {};

export default Nav;
